CREATE TABLE `tb_user_score` (
  `user_id` int(11) NOT NULL COMMENT '用户id',
  `lab_id` int(11) NOT NULL,
  `score` int(11) NOT NULL DEFAULT '0',
  `score_time` datetime DEFAULT NULL COMMENT '分数最后一次上传的时间，如果没有时间就代表没有上传',
  `homework` mediumblob,
  `homework_type` varchar(10) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '作业文件类型，因为可能出现不同的类型，但是保存blob时只保存二进制不保存名称，所以需要另外存储',
